import React from 'react';
import SurveyComponent from './components/SurveyComponent';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>SurveyJS react example</h1>
      <h2>Checkbox - none of the above and select all</h2>
      <SurveyComponent />
    </div>
  );
}

export default App;
